    dataCopy.push(user);
    setDatas(dataCopy);
    e.target.querySelectorAll("input").value = "";
    setUser(defaultUser);
  };

  useEffect(() => {
    Prism.highlightAll();
    handleData();
  }, []);

  useEffect(() => {
    handleData();
  }, [datas]);

  return (
