    <div className="title">
      <h2>👨‍💻 Data Center</h2>
    </div>
    <table id="data-table">
      <tbody>
        <tr>
          <td>Name:</td>
          <td>1</td>
          <td>2</td>
          <td>3</td>
          <td>4</td>
          <td>5</td>
          <td>Total:</td>
          <td>Average:</td>
        </tr>
        {datas.map((u, i) => (
          <tr className="user-row" key={i}>
            <td className="user-names">{u.name}:</td>
            {u.scores.map((score, i) => (
              <td className="score-card" round={i} score={score} key={i}>
                {score}
              </td>
            ))}
            <td>{u.sum}</td>
            <td>
              <b>{u.mean}</b>
            </td>
          </tr>
        ))}
      </tbody>
    </table>
    <button onClick={handleSort}>Sort</button>
    <button onClick={handleCalculate}>Calculate</button>
    <form onSubmit={handleSubmit}>
      <h3>Add new user</h3>
      <div className="new-user-box">
        <p>Name: {user.name}</p>
        <p>Scores: [{user.scores}]</p>
      </div>
      <label>Name</label>
      <input
        type="text"
        onInput={() => setUser({ ...user, name: event.target.value })}
      />
      <p>
        Scores enter a comma separated list of 5 values ex: 50, 60, 70, 50,
        65
      </p>
      <label>Scores</label>
      <input
        type="text"
        onInput={() => setUser({ ...user, scores: event.target.value })}
      />
      <button>Submit</button>
    </form>
  </div>
  );
};

export default DataCenter;
